use std::ops::Add;

#[cfg(feature = "nn-eval")]
pub type NN = Box<dyn Fn(&Array1<f32>) -> f32>;

#[cfg(feature = "nn-eval")]
pub fn nn_evaluate_game_state(
    nn: &NN,
    game_state: &GameState,
    nn_trace_container: &mut NNTrace,
) -> EvaluationResult {
    let mut res = eval_game_state(game_state, nn_trace_container);
    let y = nn(&nn_trace_container.trace);
    res.final_eval = ((y * 100.) as isize).max(-10000).min(10000) as i16;
    res
}
#[cfg(feature = "nn-eval")]
pub fn get_evaluation_parameters() -> NN {
    let w_0 = ndarray::arr1(&LAYER_0_WEIGHTS);
    let w_0 = w_0.into_shape(LAYER_0_WEIGHTS_SHAPE).unwrap();
    let b_0 = ndarray::arr1(&LAYER_0_BIAS);
    let w_1 = ndarray::arr1(&LAYER_1_WEIGHTS);
    let w_1 = w_1.into_shape(LAYER_1_WEIGHTS_SHAPE).unwrap();
    let b_1 = ndarray::arr1(&LAYER_1_BIAS);
    Box::new(move |input| {
        let mut o_0 = input.dot(&w_0).add(&b_0);
        o_0.mapv_inplace(|x| x.max(0.));
        let o_1 = o_0.dot(&w_1).add(&b_1);
        o_1[0]
    })
}
